// Get the AI text
const text = $json.output || "";

// Helper to extract each section by heading name
function extractSection(name) {
  const regex = new RegExp(`${name}:([\\s\\S]*?)(?=\\n[A-Z][^\\n]*:|$)`, "i");
  const match = text.match(regex);
  return match ? match[1].trim().replace(/^[-•]\s*/gm, "") : "";
}

// Extract each section
const areaToExplore = extractSection("Area to Explore");
const potentialFormatsRaw = extractSection("Potential Formats");
const suggestedUse = extractSection("Suggested Use");
const somethingToThinkAbout = extractSection("Something to Think About");

// Split potential formats into array and HTML list
const potentialFormats = potentialFormatsRaw
  .split(/\n+/)
  .map(s => s.trim())
  .filter(Boolean);

const formattedFormatsHTML = potentialFormats
  .map(item => `<li>${item}</li>`)
  .join("");

return [
  {
    json: {
      areaToExplore,
      potentialFormats,
      formattedFormatsHTML,
      suggestedUse,
      somethingToThinkAbout
    }
  }
];
